import ReactDOM from 'react-dom/client';
import image from "./images/galaxy2.jpg";


function App() {
  return (
    <div  style={{backgroundImage: `url(${image})`,
    height:'100%',
    width:'100%',
    backgroundSize: 'cover',
    marginTop:'-10px',
    marginBottom:'-10px',
    marginLeft:'-10px',
    marginRight:'-10px',
    backgroundRepeat : 'no-repeat',
    backgroundPosition:'centre',
    position: 'static'
    }}>
      <Form/>
    </div>
  );
}

function Form(){
 return( <div style={{
    backgroundColor:'white',
    width:'30%',
    height:'40%',
    position:'absolute',
    marginLeft:'40%',
    marginTop:'10%',

  }}>
    <h3>Login</h3>
    <form>
        <label>
          Username : <input type="text"/>
        </label>
    </form>
  </div>);
}

export default App;
